import { React } from 'react';
import {NavLink} from 'react-router-dom';
import './style.css';

function Nav(props){

    return(
        <nav className="nav">

        <NavLink className="home" to="/home">Home</NavLink>
        <NavLink className="home" to="/products">Products</NavLink>
        <NavLink className="home" to="/settings">Settings</NavLink>
        <br>
        </br>

        </nav>
    )
}

export default Nav;
